import React from 'react';


const add =(num1,num2)=>{
    return num1+num2}

 const sub =(num1,num2)=>{
    return num1-num2
    }
const mul =(num1,num2)=>{
        return num1*num2
        }
export const div =(num1,num2)=>{
            return num1/num2
            }

export {add,sub}
